import React, { Component } from 'react';



class Thirdblog extends Component {
  render() {
    return (

      <div className="main">
      <h1>
      BELGIUM!
      </h1>

      <img src="https://www.worldatlas.com/r/w728-h425-c728x425/upload/3e/cb/41/brussels.jpg" alt="Belgium">
      </img>



      <p>
      Belgium is home of the French Fry and good beer.  If you ever want to have an amazing experience go to Delerium Bar in Brussels.
      There are over 1000+ beers on tap and the bartenders are required to speak 3 different languages.  The scenery is beautiful and you will also have to take place in all of the festivities.
      </p>
      <p>
      Belgium,officially the Kingdom of Belgium, is a country in Western Europe. It is bordered by the Netherlands to the north, Germany to the east, Luxembourg to the southeast, France to the southwest, and the North Sea to the northwest. It covers an area of 30,688 square kilometres (11,849 sq mi) and has a population of more than 11.4 million. 
      </p>
      </div>

    );
  }
}

export default Thirdblog;
